COMMENT ON COLUMN "apijson_privacy"."_password" IS '登录密码';
COMMENT ON COLUMN "apijson_privacy"."_payPassword" IS '支付密码';
COMMENT ON TABLE "apijson_privacy" IS '用户隐私信息表。
对安全要求高，不想泄漏真实名称。对外名称为 Privacy';

