-- ----------------------------
-- Table structure for b_stone
-- ----------------------------
DROP TABLE "b_stone";
CREATE TABLE "b_stone" (
  "id" NUMBER(20) NOT NULL,
  "cost" NUMBER(11),
  "price" NUMBER(11),
  "length" NUMBER(11),
  "width" NUMBER(11),
  "height" NUMBER(11),
  "weight" NUMBER(8,1),
  "creationdate" DATE,
  "modifydate" DATE NOT NULL,
  "modifier" NVARCHAR2(80)
)
;
COMMENT ON COLUMN "b_stone"."cost" IS '成本';
COMMENT ON COLUMN "b_stone"."price" IS '卖价';
COMMENT ON COLUMN "b_stone"."creationdate" IS '创建时间';
COMMENT ON COLUMN "b_stone"."modifydate" IS '修改时间';

-- ----------------------------
-- Records of b_stone
-- ----------------------------
COMMIT;
COMMIT;

-- ----------------------------
-- Table structure for Comment
-- ----------------------------
DROP TABLE "Comment";
CREATE TABLE "Comment" (
  "id" NUMBER(20) NOT NULL,
  "toId" NUMBER(20) NOT NULL,
  "userId" NUMBER(20) NOT NULL,
  "momentId" NUMBER(20) NOT NULL,
  "date" DATE,
  "content" NVARCHAR2(1000) NOT NULL
)
;
COMMENT ON COLUMN "Comment"."id" IS '唯一标识';
COMMENT ON COLUMN "Comment"."toId" IS '被回复的id';
COMMENT ON COLUMN "Comment"."userId" IS '评论人 User 的 id';
COMMENT ON COLUMN "Comment"."momentId" IS '动态id';
COMMENT ON COLUMN "Comment"."date" IS '创建日期';
COMMENT ON COLUMN "Comment"."content" IS '内容';
COMMENT ON TABLE "Comment" IS '评论';

