INSERT INTO "Document" VALUES ('1602231365650', '2020', '0', '3', 'JOIN 对象支持包含多个 @ 引用赋值 的字段', 'JSON', '/get', '{   // 自动合并  ON Method.class = `Method:group`.class AND Method.package = `Method:group`.package
