DROP TABLE "Random";
CREATE TABLE "Random" (
  "id" NUMBER(20) NOT NULL,
  "toId" NUMBER(20) NOT NULL,
  "userId" NUMBER(20) NOT NULL,
  "documentId" NUMBER(20) NOT NULL,
  "count" NUMBER(11) NOT NULL,
