-- ----------------------------
-- Table structure for TestRecord
-- ----------------------------
DROP TABLE "TestRecord";
CREATE TABLE "TestRecord" (
  "id" NUMBER(20) NOT NULL,
  "userId" NUMBER(20) NOT NULL,
  "testAccountId" NUMBER(20) NOT NULL,
  "documentId" NUMBER(20) NOT NULL,
  "randomId" NUMBER(20) NOT NULL,
  "host" NVARCHAR2(1000),
  "date" DATE NOT NULL,
  "duration" NUMBER(20),
  "minDuration" NUMBER(20),
  "maxDuration" NUMBER(20),
  "response" NCLOB NOT NULL,
  "compare" NCLOB,
  "standard" NCLOB
)
;
COMMENT ON COLUMN "TestRecord"."id" IS '唯一标识';
COMMENT ON COLUMN "TestRecord"."userId" IS '用户id';
COMMENT ON COLUMN "TestRecord"."documentId" IS '测试用例文档id';
COMMENT ON COLUMN "TestRecord"."randomId" IS '随机配置 id';
COMMENT ON COLUMN "TestRecord"."date" IS '创建日期';
COMMENT ON COLUMN "TestRecord"."duration" IS '服务处理耗时，单位为毫秒(ms)';
COMMENT ON COLUMN "TestRecord"."minDuration" IS '统计过的最短服务处理耗时，单位为毫秒(ms)';
COMMENT ON COLUMN "TestRecord"."maxDuration" IS '统计过的最长服务处理耗时，单位为毫秒(ms)';
COMMENT ON COLUMN "TestRecord"."response" IS '接口返回结果JSON';
COMMENT ON COLUMN "TestRecord"."compare" IS '对比结果';
COMMENT ON COLUMN "TestRecord"."standard" IS 'response 的校验标准，是一个 JSON 格式的 AST ，描述了正确 Response 的结构、里面的字段名称、类型、长度、取值范围 等属性。';
COMMENT ON TABLE "TestRecord" IS '测试记录(必须)
主要用于保存自动化接口回归测试。5.0.0 可能改为 Test(先废弃 Test 表) ';

